package response.login;

import com.google.gson.annotations.SerializedName;

/**
 * author       : frog
 * time         : 2019/4/23 上午10:08
 * desc         : base64 验证码
 * version      :
 */
public class RespCaptcha {

    /**
     * captcha_base64 : data:image/png;base64,
     * captcha_id : captchaId_kwplllhdlj
     */

    @SerializedName("captcha_base64")
    private String captchaBase64;
    @SerializedName("captcha_id")
    private String captchaId;

    public String getCaptchaBase64() {
        return captchaBase64;
    }

    public void setCaptchaBase64(String captchaBase64) {
        this.captchaBase64 = captchaBase64;
    }

    public String getCaptchaId() {
        return captchaId;
    }

    public void setCaptchaId(String captchaId) {
        this.captchaId = captchaId;
    }

}
